import React, { Suspense } from 'react';
import { Canvas } from 'react-three-fiber';
import { GLTFLoader } from 'three/addons/loaders/GLTFLoader';
import { useLoader } from 'react-three-fiber';
import { OrbitControls } from '@react-three/drei';
import './App.css';

const RubiksCubeModel = () => {
  const { scene } = useLoader(GLTFLoader, '/rubikcube.gltf');

  // Replace 'Cube.001' with the actual name of your cube mesh
  const cubeMesh = scene.getObjectByName('Cube.001');

  if (cubeMesh) {
    // Cube mesh found, you can access its properties
    console.log('Cube Mesh:', cubeMesh);
  } else {
    console.error('Cube Mesh not found.');
  }

  return <primitive object={scene} />;
};

const RubiksCube = () => {
  return (
    <Canvas>
      <ambientLight />
      <OrbitControls enableZoom={false} />
      <Suspense fallback={null}>
        <RubiksCubeModel />
      </Suspense>
      <pointLight position={[10, 10, 10]} />
    </Canvas>
  );
};

export default RubiksCube;
